import React from 'react';
import web from '../src/Images/alpha.jpg';
import Card from './Card';

const Service = ()=>{
    return(
        <>
       <div className="my-5">
           <h1 className="text-center">Our Services</h1>
        </div>

        <div className="container-fluid mb-5">
        <div className="row">
                <div className="col-10 mx-auto">
                    <div className="row gy-4">
                        
                        <Card
                        cardimg = {web}
                        cardtitle="Java"
                        cardtext="Java is secure and platform independent"
                        cardbtn = "Start"
                        />

                        
                        <Card
                        cardimg = {web}
                        cardtitle="Python"
                        cardtext="Pyhton is secure and platform independent"
                        cardbtn = "Start"
                        />


                    </div>
                </div>
        </div>
    </div>
    </>
    )
}

export default Service;
